import Users from "./users.json";

const Card = ({ name, lastName, group, picture, id }) => {
  return (
    <div className="w-40 h-40 flex justify-center items-center flex-col bg-igray-light rounded-2xl space-y-2 shadow-md p-4">
      <img className="shadow w-20 h-20" src={picture} alt="" />
      <div className="text-xl font-semibold font-pixel text-white">{name}</div>
    </div>
  );
};

export default Card;
